def solution(stdin: str) -> str:
    n = int(stdin)
    segments = [map(int, line.split()) for line in stdin.split('\n')]
    if n == 2:
        return str(0)
    if n == 3:
        a, b = segments[0][0], segments[0][1]
        for _, r in segments[1:]:
            if a == r:
                return str(0)
            elif b == r:
                return str(0)
            else:
                a, b = a, r
    cache = [[0] * n for _ in range(n)]
    for i in range(n):
        for j in range(i, n):
            if i == j:
                cache[i][j] = segments[i][0]
            else:
                cache[i][j] = cache[i][j - 1] + segments[j][1] - segments[j][0]
    curr = cache[0][-1]
    length = max(curr, 0)
    for i in range(1, n):
        left = cache[i - 1][-1]
        right = cache[i][0]
        if left > 0 and right > 0:
            length = max(length, left + right)
    return str(length)

