def solution(stdin: str) -> str:
    n, m, k = (int(x) for x in stdin.split())

    roads = [list(map(int, x.split())) for _ in range(m)]

    distances = [[0] * n for _ in range(n)]

    for (a, b) in roads:
        distances[a - 1][b - 1] = 1
        distances[b - 1][a - 1] = 1

    # 1st solution
    options = [(0, 1) for _ in range(k)]

    def get_distance(city1: int, city2: int) -> int:
        if city1 == city2:
            return 0

        for i, distance in enumerate(distances[city1 - 1]):
            if distance:
                return i

        return -1

    for _ in range(k):
        # transform options into something like [(distance1, [2, 4]), (distance2, [1, 3]),...]
        options_distances = [(get_distance(city1, city2), [city1, city2]) for city1, city2 in options]
        options_distances.sort(key=lambda x: x[0])

        for distance, cities in options_distances:
            if len(cities) == 2:
                cities.sort()

                c1 = cities[0]
                c2 = cities[1]

                if get_distance(c1, c2) == -1:
                    # 2 cities cannot reach each other, so we'll add it to the options
                    options.append((distance, cities))
                elif distance < distances[c1 - 1][c2 - 1]:
                    # the current road is better than the previous one, so we'll remove it from options
                    options.remove((distance, cities))
                    distances[c1 - 1][c2 - 1] = distance
                    distances[c2 - 1][c1 - 1] = distance
                else:
                    # the current road is equal to or worse than the previous one, we'll keep it
                    pass

    return str(len(options))

