    # Get A and B.
    a, b = [int(x) for x in stdin.split()]

    # For each of the testcases, we first check if A can win the game. 
    # If so, we can distribute the same number of snack pieces in both cases, and we don't need to check the rest of the conditions.
    if a > b:
        return str(a) + " " + str(b)
    # If B can win the game, we need to distribute the same number of pieces in both cases, and we do not need to check the rest of the conditions.
    elif a < b:
        return str(b) + " " + str(a)
    # If neither of the above situations occur, we need to check how many pieces the guest with more pieces can take.
    else:
        # Since the number of pieces is A - B, we can distribute A - B pieces for both cases, and since there are only two guests, it is possible to distribute the same amount of pieces.
        return str(a - b) + " " + str(b)

