    def get_ladder_height(start_point: tuple[int, int], target_point: tuple[int, int], steps: int) -> int:
        """
        Returns the height of the ladder, given the start_point, target_point and steps
        >>> get_ladder_height((0, 0), (0, 1), 1)
        1
        >>> get_ladder_height((0, 0), (0, 1), 2)
        0
        """
        row, col = start_point
        target_row, target_col = target_point

        if row == target_row and col == target_col:
            return steps

        if col == target_col:
            return abs(target_row - row)

        if row == target_row:
            return abs(target_col - col)

        if abs(target_col - col) < abs(target_row - row):
            return abs(target_row - row)

        return abs(target_col - col)

    def get_ladder_length(
        start_point: tuple[int, int], target_point: tuple[int, int], steps: int
    ) -> int:
        """
        Returns the length of the ladder, given the start_point, target_point and steps
        >>> get_ladder_length((0, 0), (0, 1), 1)
        1
        >>> get_ladder_length((0, 0), (0, 1), 2)
        0
        """
        row, col = start_point
        target_row, target_col = target_point

        if row == target_row and col == target_col:
            return steps

        if col == target_col:
            return steps + abs(target_row - row)

        if row == target_row:
            return steps + abs(target_col - col)

        if abs(target_col - col) < abs(target_row - row):
            return steps + abs(target_row - row)

        return steps + abs(target_col - col)

