        [-1] * cols for _ in range(rows)
    ]  # -1 means no ladder yet

    for i in range(rows):
        for j in range(cols):
            # target_point is the goal point
            target_point = (i, j)

            # ladder_height is the height of the ladder we can reach from the current starting point
            ladder_height = get_ladder_height(start_point=(i, j), target_point=target_point, steps=0)

