    from collections import deque
    queue = deque()
    queue.append((0, 0))
    visited = [[False for _ in range(n)] for _ in range(n)]
    visited[0][0] = True
    while queue:
        r, c = queue.popleft()
        neighbors = [
            (r + 2, c + 1),
            (r + 2, c - 1),
            (r - 2, c + 1),
            (r - 2, c - 1),
            (r + 1, c + 2),
            (r + 1, c - 2),
            (r - 1, c + 2),
            (r - 1, c - 2),
        ]
        for nr, nc in neighbors:
            if nr >= 0 and nr <= n - 1 and nc >= 0 and nc <= n - 1:
                if grid[nr][nc] == 'K' and visited[nr][nc] is False:
                    return str(abs(nr - r) + abs(nc - c))
